import React from 'react'
import './style.css'

function Navbar (props){
    return (
        <div id ='navbar'>
            <img className="header" src={"./CertifiedAtmsLogo.png"}/>
            {console.log(props)}
            <span className="tabs" id="home" onClick={() => props.changeComponent('Home')} style={{back}}>Home |</span>
            <span className="tabs" id="email" onClick={() => props.changeComponent('Email')}>Email |</span>
            <span className="tabs" id="machine" onClick={() => props.changeComponent("Machine")}>Machines |</span>
        </div>
    )
}



export default Navbar;
